import "./App.css";

import Header_nav from "./Header_nav";
import Header from "./Header";
import Main_nav from "./Main_nav";
import Section from "./Section";
import Footer from "./Footer";

function App() {
  return (
    <div className="App">
      <Header_nav />
      <Header />
      <Main_nav />
      <Section />
      <Footer />
    </div>
  );
}

export default App;
